equations {'balance_of_system_cost_total'} = define() {
	if (${balance_of_system_cost_override}!=1)
	{
		return ${development_cost}+${eng_and_mgmt_cost}+${elec_infras_cost}
		+${site_access_port_staging_cost}+${plant_commissioning_cost}+
		${assembly_and_install_cost}+${other_infrastructure_cost}; //+elec_infrac
	}
	else
	{
		return ${balance_of_system_cost_input};
	}
};

equations {'balance_of_system_cost_total_mill'} = define() {
	return ${balance_of_system_cost_total}/1000000;
};

equations {'capex_check'} = define() {
	return ${device_costs_total}+${development_cost}+${eng_and_mgmt_cost}+
		${elec_infras_cost}+${assembly_and_install_cost}+${other_infrastructure_cost};
};

equations{ 'plant_commissioning_cost' } = define() {
	return ?${plant_commissioning_cost_method}
			[
				${plant_commissioning_cost_input} * ${system_capacity},
				${plant_commissioning_cost_input},
				${plant_commissioning_cost_modeled_ui}
			];
};

equations {'itemized_check_commissioning'} = define() {
	return ?${plant_commissioning_cost_method}
			[
				0,
				0,
				1
			];
};


equations {'plant_commissioning_cost_modeled_ui'} = define() {
	return 0.016*${capex_check};
};

