	show('site_access_port_staging_cost_input',value('site_access_port_staging_cost_method')!=3);
	enable('site_access_port_staging_cost_input',value('site_access_port_staging_cost_method')!=2);

	//Assembly and Install
	show('assembly_and_install_cost_total',value('assembly_and_install_cost_method')==3);
	show('assembly_and_install_cost_input',value('assembly_and_install_cost_method')!=3);
	enable('assembly_and_install_cost_input',value('assembly_and_install_cost_method')!=2);

	//Other Infrastructure
	show('other_infrastructure_cost_total',value('other_infrastructure_cost_method')==3);
	show('other_infrastructure_cost_input',value('other_infrastructure_cost_method')!=3);
	enable('other_infrastructure_cost_input',value('other_infrastructure_cost_method')!=2);

